import React from 'react'

class ListItems extends React.Component {
    render() {
        const { items } = this.props
        return(
            <div>
                <ul>
                    {
                        items.map((i, item) => {
                            <li key={i}>
                                <p>{item.name}</p>
                                <p>{item.name}</p>
                                <p>{item.name}</p>
                            </li>
                        })
                    }
                </ul>
            </div>
        )
    }
}

export default ListItems
